            textAlign: 'center',

        },
        heading: {
            fontSize: '36px',
            marginBottom: '30px',
        },
    };
    return (
        <div style={styles.container}>
       <div>
           <h1>•	Project Summary</h1>
       </div>

            <div>
                <h1>•	Project Vision</h1>
            </div>

            <div>
                <h1>•	Project/Business Requirements</h1>
            </div>

            <div>
                <h1>•	Project Plan</h1>
            </div>

            <div>
                <h1>•	Requirements Analysis and Design </h1>
            </div>

            <div>
                <h1>•	Wireframes/Mock ups</h1>
            </div>

            <div>
                <h1>•	Status Reports</h1>
            </div>

            <div>
                <h1>•	System Implementation</h1>
            </div>

        </div>
    );
};
